import React, { StrictMode } from "react"; // Import from react
import { createRoot } from "react-dom/client"; // Correct way to import createRoot
import "./styles.css"; // Your CSS file for styling

import App from "./App"; // Your main App component

// Get the root element where React will render your app
const root = createRoot(document.getElementById("root"));

// Render the App inside StrictMode
root.render(
  <StrictMode>
    <App />
  </StrictMode>
);
